let pagination = (props)=>{
return(
  <React.Fragment>
    <div className ="contentAlign">    
            <div>Showing Results 1 to 10 of 57</div>       
            {/* <nav style={{'width': '100%','padding-left': '40%'}}> */}
            <div className = {classes.page-list}>
                <ul  style = {{'list-style':'none','display': 'flex','padding-left': '0','border-radius': '.25rem','margin-top': 'auto'}}>
                      <li className ="page-item"> Prev</li>
                      <li className ="page-item">1</li>
                      <li className ="page-item">2</li>
                      <li className ="page-item">3</li>
                      <li className ="page-item">4</li>
                      <li className ="page-item">Next</li>
                 </ul>
            </div>                
             {/* </nav> */}   
    </div>
     
  </React.Fragment>
  
)
}
export default pagination;
